    isLoggedIn: false
  }

  haveLoggedIn () {
    this.setState({isLoggedIn : true})
  }

   render (){
          return (<BrowserRouter>
               <Route path="/login" exact component={Login} />
               <Route path="/" exact component={Home} />
             </BrowserRouter>);
   }
}

export default App;
